        public static bool VerifySignature(AcroFields fields, String name)
        {
            Console.WriteLine("Signature covers whole document: " + fields.SignatureCoversWholeDocument(name));
            Console.WriteLine("Document revision: " + fields.GetRevision(name) + " of " + fields.TotalRevisions);
            PdfPKCS7 pkcs7 = fields.VerifySignature(name);
            var x = pkcs7.Verify();
            Console.WriteLine("Integrity check OK? " + x);
            return x;
        }

        private void button2_Click(object sender, EventArgs e)
        {
            byte[] bDataFile = System.IO.File.ReadAllBytes("document/giayravien.pdf");
            bool valid = false;
            try
            {
                string key = "4288161d272f4622b23e52697346ad8d";
                string secret = "eHi3x+c4nQZYuVQRZV3d1WcB46aCzMQhNR4KcSpY";
                var signer = new PDFSigner(key, secret, "hn1");
                var signed = signer.SignHashPkcs(bDataFile, "SHA-1", TYPE_PDFSIGNATURE_TEXTIMA, DEFAULT_BASE64_IMAGE, "Giám đốc", "CKS_GIAMDOC");
                if (signed == null)
                {
                    return;
                }
                PdfReader r = new PdfReader(signed);
                AcroFields af = r.AcroFields;
                List<String> listNames = af.GetSignatureNames();

                foreach (string signam in listNames)
                {
                    if (VerifySignature(af, signam) == false)
                    {
                        valid = false;
                        return;
                    }
                }
                System.IO.File.WriteAllBytes(key + ".signed.pdf", signed);
            }
            catch (Exception ex)
            {
                ex.GetHashCode();
            }
            finally
            {

            }
        }

        private void button3_Click(object sender, EventArgs e)
        {

            string resourceEndpoint = "https://sign-hn1.vin-hsm.com/api/v2/xml/sign/defaultdata";
            // Create a uri you are going to call.
            var requestUri = new Uri($"{resourceEndpoint}");
            var body = new
            {
                createTokenWithScopes = new[] { "chat" }
            };

            var serializedBody = JsonConvert.SerializeObject(body);

            var requestMessage = new HttpRequestMessage(HttpMethod.Post, requestUri)
            {
                Content = new StringContent(serializedBody, Encoding.UTF8, "application/json")
            };


            // Specify the 'x-ms-date' header as the current UTC timestamp according to the RFC1123 standard
            var date = DateTimeOffset.UtcNow.ToString("r", CultureInfo.InvariantCulture);
            // Get the host name corresponding with the 'host' header.
            var host = requestUri.Authority;
            // Compute a content hash for the 'x-ms-content-sha256' header.
            var contentHash = ComputeContentHash(serializedBody);

            // Prepare a string to sign.
            var stringToSign = $"POST\n{requestUri.PathAndQuery}\n{date};{host};{contentHash}";
            // Compute the signature.
            var signature = ComputeSignature(stringToSign);
            // Concatenate the string, which will be used in the authorization header.
            var authorizationHeader = $"HMAC-SHA256 SignedHeaders=x-ms-date;host;x-ms-content-sha256&Signature={signature}";

            // Add a date header.
            requestMessage.Headers.Add("x-ms-date", date);

            // Add a host header.
            // In C#, the 'host' header is added automatically by the 'HttpClient'. However, this step may be required on other platforms such as Node.js.

            // Add a content hash header.
            requestMessage.Headers.Add("x-ms-content-sha256", contentHash);

            // Add an authorization header.
            requestMessage.Headers.Add("Authorization", authorizationHeader);


            HttpClient httpClient = new HttpClient
            {
                BaseAddress = requestUri
            };
            var response = httpClient.SendAsync(requestMessage);
            //var responseString = response.Content.ReadAsStringAsync();
            //Console.WriteLine(responseString);
        }
        static string ComputeContentHash(string content)
        {
            var sha256 = SHA256.Create();
            byte[] hashedBytes = sha256.ComputeHash(Encoding.UTF8.GetBytes(content));
            return Convert.ToBase64String(hashedBytes);
        }
        static string ComputeSignature(string stringToSign)
        {
            string secret = "4288161d272f4622b23e52697346ad8d";
            var hmacsha256 = new HMACSHA256(Convert.FromBase64String(secret));
            var bytes = Encoding.UTF8.GetBytes(stringToSign);
            var hashedBytes = hmacsha256.ComputeHash(bytes);
            return Convert.ToBase64String(hashedBytes);
        }
